Haunt of the Harpy

Nature Documentary hosted by Bill Ratner, published by ZDF in 2010 - English narration


Information
------------------------------

With talons bigger than a grizzly bear's and the sharpest eye and beak in nature, the Harpy eagle rules the canopy of the unsoiled South American rainforest. But little is known about this powerful raptor, specifically its mating and rearing habits. That's because finding them in the dense and often treacherous Amazon requires great experience, endurance, patience and courage. Join wildlife experts Rainer Bergomaz and Yung Sandy as they leave civilization behind and brave perilous rapids and poisonous reptiles on their hunt for the Harpy.

